import pandas as pd
from datetime import datetime
from sklearn.preprocessing import StandardScaler
from sklearn.cluster import KMeans
import matplotlib.pyplot as plt

"""Step 1 : Read the data"""

retail_data = pd.read_csv('/content/online_retail_data.csv')

retail_data.shape

retail_data.size

retail_data.describe()

"""Step 2 : Data Preprocessing

Datetime Transformation: Begin by converting the 'InvoiceDate' field into a usable datetime format. This ensures consistency and facilitates time-based analysis.

Quantity Sanity Check: Weed out anomalies by removing transactions with negative quantities. This step ensures that the dataset reflects accurate and valid transaction details.

Total Price Computation: Calculate the total price for each transaction. This aggregated metric provides a comprehensive view of the monetary value associated with each entry.

CustomerID Validation: Strengthen the dataset by ensuring the presence of a valid 'CustomerID' for each record. This step is crucial for meaningful customer-centric analysis and segmentation.
"""

# Convert 'InvoiceDate' to datetime
retail_data['InvoiceDate'] = pd.to_datetime(retail_data['InvoiceDate'], format='%d/%m/%y %H:%M')

retail_data = retail_data[retail_data['Quantity'] > 0]  # Remove negative quantities

retail_data['TotalPrice'] = retail_data['Quantity'] * retail_data['UnitPrice']

retail_data = retail_data.dropna(subset=['CustomerID'])

retail_data['CustomerID'] = retail_data['CustomerID'].astype(int)

"""Step 3 : Revealing Customer Insights:  RFM Analysis

Establishing a Reference Date: A crucial step involved setting a reference date, strategically positioned as one day after the latest purchase recorded in the dataset. This date serves as the anchor for assessing recency, aligning with the essence of customer engagement.

Grouping by Customer: The data took on a new structure as I grouped it by customer. This organizational shift laid the foundation for personalized insights, allowing a granular exploration of individual customer behavior.

Recency, Frequency, and Monetary Calculations:

Recency: Determining how recently a customer made a purchase, gauging the temporal proximity of their engagements.
Frequency: Unraveling the number of purchases each customer has made, providing insights into their interaction patterns.
Monetary Value: Quantifying the total amount spent by each customer, a pivotal metric capturing their overall financial contribution.
"""

# RFM Calculation
reference_date = retail_data['InvoiceDate'].max() + pd.Timedelta(days=1)

rfm_data = retail_data.groupby('CustomerID').agg({
    'InvoiceDate': lambda x: (reference_date - x.max()).days,
    'InvoiceNo': 'count',
    'TotalPrice': 'sum'
}).rename(columns={'InvoiceDate': 'Recency', 'InvoiceNo': 'Frequency', 'TotalPrice': 'Monetary'})

"""Striking Harmony: Normalization and Optimal Cluster Count in Data Analysis

Standardized the Recency, Frequency, and Monetary values using the StandardScaler, aligning them on a uniform scale for optimal K-Means clustering. To pinpoint the ideal number of clusters, employed the Elbow Method. This involved plotting the within-cluster sum of squares (WCSS) against various cluster counts, searching for the pivotal 'elbow' point where the WCSS exhibits a discernible plateau.
"""

# Normalizing the RFM data for K-Means
scaler = StandardScaler()
rfm_normalized = scaler.fit_transform(rfm_data[['Recency', 'Frequency', 'Monetary']])

# Determining the optimal number of clusters using the Elbow Method
wcss = []
for i in range(1, 11):
    kmeans = KMeans(n_clusters=i, init='k-means++', max_iter=300, n_init=10, random_state=0)
    kmeans.fit(rfm_normalized)
    wcss.append(kmeans.inertia_)

# Plotting the results to find the 'elbow'
plt.figure(figsize=(10, 6))
plt.plot(range(1, 11), wcss, marker='o', linestyle='--')
plt.title('Elbow Method to Determine Optimal Number of Clusters')
plt.xlabel('Number of Clusters')
plt.ylabel('WCSS')
plt.show()

"""Step 4: K-Means Clustering"""

# K-Means Clustering
kmeans = KMeans(n_clusters=4, init='k-means++', max_iter=300, n_init=10, random_state=0)
clusters = kmeans.fit_predict(rfm_normalized)
rfm_data['Cluster'] = clusters
rfm_data

"""Step 4 : Decoding Customer Clusters: Analysis Breakdown"""

# Analyzing the Clusters
cluster_analysis = rfm_data.groupby('Cluster').agg({
    'Recency': 'mean',
    'Frequency': 'mean',
    'Monetary': 'mean'
}).sort_values(by='Cluster', ascending=True)
cluster_analysis['Count'] = rfm_data.groupby('Cluster').size()
cluster_analysis

